function Expenses(){
    let Expense=[

        {
          id : 'e1',
          title : 'school Fee',
          amount : 5500,
          date : "15 oct 2022"
        },
        {
         id : 'e2',
         title : 'books',
         amount:1200,
         date : "13 oct 2022"
       },
       {
         id : 'e3',
         title : 'milk',
         amount:60,
         date : "12 oct 2022"
       },
       {
         id : 'e4',
         title : 'biscit',
         amount:10,
         date : "10 oct 2022"
       }




];

return(
    <div>
         <ExpenseItem
       date={Expense[0].date}
      title={Expense[0].title}
      amount={Expense[0].amount}>
        </ExpenseItem> 
        <ExpenseItem
       date={Expense[1].date}
      title={Expense[1].title}
      amount={Expense[1].amount}>
        </ExpenseItem> 
        
        <ExpenseItem
       date={Expense[2].date}
      title={Expense[2].title}
      amount={Expense[2].amount}>
        </ExpenseItem> 
        
        <ExpenseItem
       date={Expense[3].date}
      title={Expense[3].title}
      amount={Expense[3].amount}>
        </ExpenseItem> 
        

    </div>
)

}

export default Expenses;
